    false,nt"url": null,nt"notes": "This narrative report for Aleutian Islands
    NWR, Izembek Bay, and Cold Bay Area outlines Refuge accomplishments from June, 1956
    to June, 1957. The report begins by summarizing the weather conditions and water
    conditions during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments and wildfires. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, hunting, and fishing.",nt"license_title":
